const Search = () => {
  return (
    <div className="flex items-center space-x-2">
    <input type="search" placeholder="Search..." className="px-4 py-2 border border-gray-300 rounded-lg w-full focus:border-blue-500 focus:ring focus:ring-blue-500 focus:ring-opacity-50" />
    <button className="p-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600">
        Search
    </button>
</div>

  )
}

export default Search
